import React from "react";

function HomeIcons({ icons, alt, textIcon }) {
  return (
    <div className="d-flex flex-column align-items-center text-center" style={{maxWidth: 75, cursor: 'pointer'}}>
      <img src={icons} alt={alt} className="img-fluid mb-3" />
      <small>{textIcon}</small>
    </div>
  );
}

export default HomeIcons;
